export default function sample(){
    const [count,setCount] = useState(0);
    function handleClick(){
        console.log("my btn ic clicked",count);
        setCount(count+1);
    }
    return(
        <>
        <p>the value of count is{count}</p>
        <button onClick={handleClick}>click me</button>
        </>
    )
}
